  //       "Content-Type": "application/x-www-form-urlencoded",
  //     },
  //     body: `email=${email}`,
  //   })
  //     .then((response) => response.json())
  //     .then((data) => {
  //       if (data.success) {
  //         setClasses(data.classes);
  //       } else {
  //         console.error("Server response indicated an error.");
  //       }
  //     })
  //     .catch((error) => {
  //       console.error("Error:", error);
  //     });
  // };

  // useEffect(() => {
  //   loadClasses();
  // }, []);
  const loadPrograms = async () => {
    fetch("https://sxt9335.uta.cloud/getName.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `email=${email}`,
    })
      .then((response) => response.text())
      .then((data) => {
        setName(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };
  useEffect(() => {
    loadPrograms();
  }, []);
  const loadClasses = () => {
    fetch("https://sxt9335.uta.cloud/viewClassesEnrolled.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `email=${email}`,
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.success) {
          setClasses(data.classes);
        } else {
          console.error("Server response indicated an error.");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  useEffect(() => {
    loadClasses();
  }, []);
  const loadExams = () => {
    fetch("https://sxt9335.uta.cloud/viewClassesEnrolled.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `email=${email}`,
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.success) {
          setClasses(data.classes);
        } else {
          console.error("Server response indicated an error.");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  useEffect(() => {
    loadExams();
  }, []);
  return (
    <div className="stylecontainer">
      <div className="stylesidebar">
        <link
          rel="stylesheet"
          href="https://use.fontawesome.com/releases/v5.15.4/css/all.css"
          integrity="sha384-DyZ88mC6Up2uqS4h/KRgHuoeGwBcD4Ng9SiP4dIRy0EXTlnuz47vAwmeGwVChigm"
          crossorigin="anonymous"
        />
        <ul>
          <li>
            <Link to="/home">
              <i className="fas fa-book"></i>
              <div className="styletitle">SkillBridge</div>
            </Link>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-th-large"></i>
              <div className="styletitle">Student Dashboard</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Manage Profiles</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Trobleshoot Issues</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Grant Permissions</div>
            </a>
          </li>
          <li>
            <Link to={`/edit?email=${email}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">Edit Profile</div>
            </Link>
          </li>
          <li>
            <Link to={`/messagechat?name=${name}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">WebChat</div>
            </Link>
          </li>
          <li>
            <Link to="/login">
              <i className="fas fa-user"></i>
              <div className="styletitle">Logout</div>
            </Link>
          </li>
        </ul>
      </div>
      <div className="stylemain">
        <div className="styletop-bar">
          <div className="stylesearch">
            <input type="text" name="search" placeholder="Search here.." />
            <label htmlFor="search">
              <i className="fas fa-search"></i>
            </label>
          </div>
          <i className="fas fa-bell"></i>
          <div className="styleuser">
            <img src={avatar1} alt="skillbridge" />
          </div>
        </div>
        {/* <div className="stylecards">
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">5 </div>
              <div className="stylecard-name">Roles</div>
              <div className="stylecard-name">Roles</div>
              <div className="stylecard-name">Roles</div>
              <div className="stylecard-name">Roles</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">67</div>
              <div className="stylecard-name">Courses</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">5</div>
              <div className="stylecard-name">Exams</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">7</div>
              <div className="stylecard-name">Assignments</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
        </div> */}

        {/* new Cards */}

        <div className="stylecards">
          {classes.map((res, index) => (
            <div
              className="homeheroservice-item"
              key={index}
              style={{ backgroundImage: `url(${backgroundImage})` }}
            >
              {/* <div className="homeheroicon">
                <img
                  src="https://img.icons8.com/bubbles/100/000000/services.png"
                  alt="Icon"
                />
              </div> */}
              <div className="styleicon-box">
                <i className="fas fa-tag"></i>
              </div>
              <h2>{res.courseName}</h2>
              <p>
                Course Materials: {res.resources}
                <br />
                Student Id: {res.email}
                <br />
                Course ID: {res.courseId}
                <br />
                Professor Name: {res.professorName}
                <br />
                Percentage: {res.percentage}
                <br />
                Grade: {res.grade}
              </p>
            </div>
          ))}
        </div>

        {/* new cards */}
        <div className="styletables">
          {/* Course Catalog */}
          <div className="StyleAllRoles">
            <div className="styleheading">
              {/* <Link to={`/addProgram?email=${email}`} className="stylebtn">
                Add Program
              </Link> */}
              <h2>Manage Courses</h2>
              <a href="#" className="stylebtn">
                View All
              </a>
            </div>
            <table className="styleroles">
              <thead>
                <tr>
                  <th>S No</th>
                  <th>Exam Name</th>
                  <th>Start Time</th>
                  <th>End Time</th>
                  <th>Quiz Link</th>
                  <th>Course Materials</th>
                  {/* <th>Actions</th> */}
                </tr>
              </thead>
              <tbody>
                {classes.map((res, index) => (
                  <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{res.exam}</td>
                    <td>{res.startTime}</td>
                    <td>{res.endTime}</td>
                    <td>{res.quizlink}</td>
                    <td>{res.resources}</td>
                    {/* <td>
                      <i className="fas fa-eye"></i>
                      &nbsp;
                      <i
                        className="fas fa-edit"
                        // onClick={() => handleProgramEdit(res)}
                      ></i>
                      &nbsp;
                      <i
                        className="fas fa-trash"
                        // onClick={() => handleProgramDelete(res.UTA_ID)}
                      ></i>
                      &nbsp;
                    </td> */}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
          {/* Course Catalog */}
        </div>

        {/* New code */}
      </div>
    </div>
  );
}

export default Student;
